	<script>
		var adshandler = window["__gb_adshandler"];
		adshandler.on("gameover", function (data) {
			console.log("gameover: " + (data == null ? "null" : JSON.stringify(data)));
		});
		adshandler.on("update", function (data) {
			console.log("update: " + (data == null ? "null" : JSON.stringify(data)));
		});
		adshandler.on("ready", function (data) {
			console.log("ready: " + (data == null ? "null" : JSON.stringify(data)));
			document.getElementById("startButtonId").style.visibility = "visible";
		});
		adshandler.gameplay.finishLineZ = 0;
		adshandler.gameplay.shadows = false;
		adshandler.gameplay.blood = true;
		adshandler.gameplay.bloodColor = 0xFF0000;
		adshandler.gameplay.lightIntensity = 1.0;
		function showMenu() {
			let div = document.createElement("div");
			div.id = 'startButtonId'
			div.className = "gbutton";
			div.style.zIndex = "11";
			div.style.position = "absolute";
			div.style.bottom = "20px";
			div.style.left = "20px";
			div.style.padding = "10px";
			div.style.borderRadius = "3px";
			div.style.backgroundColor = "#80deea";
			div.innerHTML = "START";
			document.body.appendChild(div);
			div.onclick = function () {
				adshandler.start();
			}
			div.style.visibility = "hidden";
		}

		showMenu();
	</script>
